import React from "react";
import "./Jars.css";


const Jar = (props) => (
    <div className={props.class}  onClick={props.onClick}>
        <div className="jar-info">
            <img
                alt={props.id}
                src={props.image}
            />
            <h3>{props.Name}</h3>
            <h3>{'$' + props.Amount}</h3>
        </div>
    </div>
);


export default Jar;
